import{_ as e,c as a,o as r,a5 as o}from"./chunks/framework.sTBfJIaM.js";const f=JSON.parse('{"title":"Módulo de Arrendadores/Propietarios","description":"","frontmatter":{},"headers":[],"relativePath":"administrator/modulo-de-arrendadores.md","filePath":"administrator/modulo-de-arrendadores.md"}'),t={name:"administrator/modulo-de-arrendadores.md"},i=o('<h1 id="modulo-de-arrendadores-propietarios" tabindex="-1">Módulo de Arrendadores/Propietarios <a class="header-anchor" href="#modulo-de-arrendadores-propietarios" aria-label="Permalink to &quot;Módulo de Arrendadores/Propietarios&quot;">​</a></h1><p>Este módulo permite la gestión de los arrendadores o propietarios de las propiedades listadas en la plataforma. Aquí puedes añadir nuevos arrendadores, actualizar su información, y asociar o desasociar propiedades a su nombre.</p><h2 id="acceso-al-modulo" tabindex="-1">Acceso al Módulo <a class="header-anchor" href="#acceso-al-modulo" aria-label="Permalink to &quot;Acceso al Módulo&quot;">​</a></h2><p>Para acceder al módulo de arrendadores/propietarios:</p><ol><li>Dirígete al menú lateral izquierdo de la pantalla.</li><li>Selecciona la opción &quot;Arrendadores&quot; o &quot;Propietarios&quot;.</li></ol><p>En esta sección, encontrarás un listado de todos los arrendadores registrados, con opciones para gestionar su información y propiedades asociadas.</p><h2 id="gestion-de-arrendadores-propietarios" tabindex="-1">Gestión de Arrendadores/Propietarios <a class="header-anchor" href="#gestion-de-arrendadores-propietarios" aria-label="Permalink to &quot;Gestión de Arrendadores/Propietarios&quot;">​</a></h2><h3 id="creacion-de-arrendador-propietario" tabindex="-1">Creación de Arrendador/Propietario <a class="header-anchor" href="#creacion-de-arrendador-propietario" aria-label="Permalink to &quot;Creación de Arrendador/Propietario&quot;">​</a></h3><p>Para registrar un nuevo arrendador en el sistema:</p><ol><li>Haz clic en el botón &quot;Agregar Arrendador&quot; en la parte superior de la vista del módulo.</li><li>Completa el formulario con la información del arrendador.</li></ol><h3 id="listado-de-arrendadores-propietarios" tabindex="-1">Listado de Arrendadores/Propietarios <a class="header-anchor" href="#listado-de-arrendadores-propietarios" aria-label="Permalink to &quot;Listado de Arrendadores/Propietarios&quot;">​</a></h3><p>Aquí se muestra una lista completa de todos los arrendadores, permitiéndote acceder rápidamente a su información y gestionar las propiedades asociadas.</p><h3 id="modificar-actualizar-arrendador-propietario" tabindex="-1">Modificar/Actualizar Arrendador/Propietario <a class="header-anchor" href="#modificar-actualizar-arrendador-propietario" aria-label="Permalink to &quot;Modificar/Actualizar Arrendador/Propietario&quot;">​</a></h3><p>Para actualizar la información de un arrendador:</p><ol><li>Selecciona el arrendador deseado del listado.</li><li>Haz clic en &quot;Editar&quot; para modificar sus datos.</li></ol><h3 id="propiedades-asociadas-al-arrendador" tabindex="-1">Propiedades Asociadas al Arrendador <a class="header-anchor" href="#propiedades-asociadas-al-arrendador" aria-label="Permalink to &quot;Propiedades Asociadas al Arrendador&quot;">​</a></h3><p>Dentro de la ficha de cada arrendador, podrás ver y gestionar las propiedades que le están asociadas, facilitando la administración centralizada de la información.</p><p>Este módulo es esencial para mantener una relación clara entre propiedades y sus respectivos propietarios, asegurando una gestión eficaz del inventario inmobiliario.</p><h3 id="permissions" tabindex="-1">Permissions <a class="header-anchor" href="#permissions" aria-label="Permalink to &quot;Permissions&quot;">​</a></h3><p>When we talk about dialer, in addition to the ordinary permissions such as view, create, delete, and modify, there is also certain special permissions, below is a brief explanation of them.</p><p>You can choose from default values by selecting a country, and then customize them according to your needs. Alternatively, you have the option to configure all the settings manually based on your preferences. The variables are the following:</p><table><thead><tr><th>Field</th><th>Description</th></tr></thead><tbody><tr><td><strong>initialSilence</strong></td><td>Is maximum initial silence duration before greeting</td></tr><tr><td><strong>greeting</strong></td><td>is the maximum length of a greeting</td></tr><tr><td><strong>afterGreetingSilence</strong></td><td>Is the silence after detecting a greeting</td></tr><tr><td><strong>totalAnalysisTime</strong></td><td>Is the maximum time allowed for the algorithm to decide on whether the audio represents a HUMAN, or a MACHINE</td></tr><tr><td><strong>minimumWordLength</strong></td><td>Is the minimum duration of Voice considered to be a word</td></tr><tr><td><strong>betweenWordsSilence</strong></td><td>Is the minimum duration of silence after a word to consider the audio that follows to be a new word</td></tr><tr><td><strong>maximumNumberOfWords</strong></td><td>Is the maximum number of words in a greeting. If this is REACHED, then the result is detection as a MACHINE</td></tr><tr><td><strong>silenceThreshold</strong></td><td>What is the average level of noise from 0 to 32767 which if not exceeded, should be considered silence?</td></tr></tbody></table><hr>',23),d=[i];function s(n,l,c,p,u,m){return r(),a("div",null,d)}const g=e(t,[["render",s]]);export{f as __pageData,g as default};
